    false,nt"url": null,nt"notes": "The avifauna of Amchitka Island was surveyed
    during June, 1967, in order to: form a basis for predicting the nature and magnitude
    of effects on the bird population of the proposed nuclear tests and for determining
    whether or not the tests can be conducted without producing unacceptable hazards
    to the avifauna, the environment, and man; and to provide pretest data for assessing
    the effects of any tests that are conducted. The results of this work are found
